# -*- coding: utf-8 -*-

import arcpy
import numpy as np

# Get parameters
#  get the CNs, "Be-10" or "Al-26"
CNs = arcpy.GetParameterAsText(3)
#  get the vegetation constant, a, for model E = f(slope, precipitation, vegetation cover)
a = float(arcpy.GetParameterAsText(13))

# atmospheric attenuation length [g/cm2] (Braucher et al., 2011).
atmospheric_attenuation_fm = 510
atmospheric_attenuation_sm = 260

# ground attenuation length [g/cm2] (Braucher et al., 2011) and (Heisinger et al., 2002b)
# high-energy neutrons
attenuation_neutron = 160.0
# fast muon
attenuation_fmuon = 4320.0
# slow muon
attenuation_smuon = 1500.0

# The proportions of production rate of sp, fm, and sm to the total production rate at SLHL 
if CNs == "Be-10":
    ## From COSMOCALC version 2.0 to mimic Braucher et al. (2011) | OCTOPUS (Mudd et al., 2016) 
    # high-energy neutron spallation
    proportion_sp = 0.9887
    # fast muon interaction
    proportion_fm = 0.0086
    # slow/negative muon capture
    proportion_sm = 0.0027

elif CNs == "Al-26":
    # Mudd et al. (2016), Note, their Table 2 has problems on these fractions （their sum isn't 1）!
    # high-energy neutron spallation
    proportion_sp = 0.9699
    # fast muon interaction
    proportion_fm = 0.0026
    # slow/negative muon capture
    proportion_sm = 0.0275

#  production rate of CNs at SLHL [atoms/g/yr]
if CNs == "Be-10":
    production_CN_SLHL = 4.30 # From COSMOCALC version 2.0 Vermeesch (2007) to mimic Braucher et al. (2011) | OCTOPUS (Mudd et al., 2016) 
elif CNs == "Al-26":
    production_CN_SLHL = 31.10 # From COSMOCALC version 2.0 Vermeesch (2007) | OCTOPUS (Mudd et al., 2016)

# Production rate of CNs at SLHL caused by sp, fm, sm [atoms/g/yr].
production_CN_SLHL_sp = production_CN_SLHL * proportion_sp
production_CN_SLHL_fm = production_CN_SLHL * proportion_fm
production_CN_SLHL_sm = production_CN_SLHL * proportion_sm

# The decay constant [yr-1]
if CNs == "Be-10":
    decay_constant_CN = 5e-7 # Chmeleff et al. (2010) | OCTOPUS (Mudd et al., 2016)
elif CNs == "Al-26":
    decay_constant_CN = 9.8e-7 # (Gosse and Phillips, 2001) | OCTOPUS (Mudd et al., 2016)

